  margin: 20px 0;
  height: 100%;
`;

function SearchSection({ searchResults }) {
  return (
    <Div>
      {searchResults.map((searchResult, index) => {
        <div key={index}>{searchREsult}</div>;
      })}
    </Div>
  );
}
